// === Add-ons ===
function findMedico(nombre){
  if(!nombre) return null;
  const n = nombre.trim().toLowerCase();
  return MEDICOS.find(m => (m.Doctor||'').toLowerCase() === n) || null;
}
function setKAMAndPhoneFromMedico(nombre){
  const m=findMedico(nombre);
  const kamInput=document.getElementById('kam');
  const tel=document.getElementById('telefono');
  const wa=document.getElementById('waLink');
  if(m){
    if(kamInput) kamInput.value=m.KAM||'';
    if(tel) tel.textContent=m["TELEFONO KAM"]||'';
    if(wa){ let num=(m["TELEFONO KAM"]||'').replace(/[^0-9]/g,''); wa.href=num?`https://wa.me/52${num}`:'#'; }
  }else{
    if(kamInput) kamInput.value='';
    if(tel) tel.textContent='';
    if(wa) wa.href='#';
  }
}
document.getElementById('medico').addEventListener('change',e=>setKAMAndPhoneFromMedico(e.target.value));
// Folio counter
(function(){
  const KEY='nomad_quote_counter';
  let n=parseInt(localStorage.getItem(KEY)||'0'); if(isNaN(n)) n=0;
  n+=1; localStorage.setItem(KEY,n);
  const el=document.getElementById('folioCotizacion');
  if(el) el.textContent=`Nomad-${String(n).padStart(2,'0')}`;
})();


// --- Integración de PDF con WhatsApp y contador de descargas ---
// Nota: requiere que tengas una variable global `currentUser` asignada cuando el login es exitoso.
function descargarPDF() {
  const element = document.getElementById('cotizador');
  const opt = {
    margin: 0.5,
    filename: 'Cotizacion.pdf',
    image: { type: 'jpeg', quality: 0.98 },
    html2canvas: { scale: 2 },
    jsPDF: { unit: 'in', format: 'letter', orientation: 'portrait' }
  };

  // Enlace de WhatsApp dinámico
  const waLink = document.getElementById("waLink");
  if (waLink) {
    waLink.href = "https://wa.me/52552558403?text=Hola%20quiero%20más%20información";
  }

  // Generar PDF
  html2pdf().set(opt).from(element).save();

  // Registrar descarga en Google Sheets con usuario
  let usuario = (typeof currentUser !== "undefined" && currentUser) ? currentUser : "desconocido";

  fetch("https://script.google.com/macros/s/AKfycbxT9AQpFe6_errqhEzkeyGRL_CR6fzurHn6LQvMl2AW6j_1BLKqzVWbSYq9CcYl9dmxFA/exec?usuario=" + encodeURIComponent(usuario))
    .then(response => {
      if (!response.ok) {
        throw new Error("Fallo al registrar descarga");
      }
      return response.text();
    })
    .then(data => {
      console.log("Descarga registrada:", data);
    })
    .catch(error => {
      console.error("Error al registrar la descarga:", error);
    });
}